import { useEffect, useState } from "react"
import { useNavigate, useParams } from "react-router-dom"
import { fetchStudentById, putStudentInDatabase } from "../../services/studentServices"
import { fetchGrades } from "../../services/gradeServices"

export const EditStudent = () => {

    const [editStudent, setEditStudent] = useState({})
    const [grades, setGrades] = useState([])

    const navigate = useNavigate()

    const { studentId } = useParams()

    const handleFetchCalls = () => {
        fetchStudentById(studentId).then((data) => {
            setEditStudent(data)
        })
        fetchGrades().then((data) => {
            setGrades(data)
        })
    }

    const handleInput = (event) => {
        const name = event.target.name
        const value = event.target.value
        const copy = { ...editStudent }
        copy[name] = value
        console.log("copy", copy)
        setEditStudent(copy)
    }

    const handleUpdate = (event) => {
        event.preventDefault()
        putStudentInDatabase(editStudent).then(() => {
            navigate('/students')
        })
    }

    useEffect(() => {
        handleFetchCalls()
    }, [studentId])

    return (
        <div
            className="flex min-h-full flex-1 flex-col justify-center px-6 py-12 lg:px-8">
            <div
                className="sm:mx-auto sm:w-full sm:max-w-sm">
